import whiteLogo from "../images/real1.jpg";
import colorLogo from "../images/real1.jpg";

const Nav = ({ authToken, minimal, setShowModal, showModal, setIsSignUp }) => {
  const handleClick = () => {
    setShowModal(true);
    setIsSignUp(false);
  };

  return (
    <nav className={minimal ? "minimal" : ""}>
      <div className="logo-container">
        <img
          className={`logo ${minimal ? "minimal" : ""}`}
          src={minimal ? colorLogo : whiteLogo}
          alt="logo"
        />
      </div>
      {!authToken && !minimal && (
        <button
          className="nav-button"
          onClick={handleClick}
          disabled={showModal}
        >
          Log in
        </button>
      )}
    </nav>
  );
};
export default Nav;
